import React, { useState } from 'react';

function SlidingImages() {
    const images = [
        "/icons/events&activities/e&a1.jpg",
        "/icons/events&activities/e&a2.jpg",
        "/icons/events&activities/e&a3.jpg",
        "/icons/events&activities/e&a4.jpg",
        "/icons/events&activities/e&a5.jpg",
        "/icons/events&activities/e&a6.jpg",
        "/icons/events&activities/e&a7.jpg",
        "/icons/events&activities/e&a8.jpg",
        "/icons/events&activities/e&a9.jpg",
        "/icons/events&activities/e&a10.jpg"
    ];

    const [start, setStart] = useState(0);

    const handleClick = (direction) => {
        if (direction === "prev") {
            setStart(Math.max(0, start - 3));
        } else {
            setStart(Math.min(images.length - 3, start + 3));
        }
    };

    return (
        <div className="sliding-images">
            <div className="image-group">
                {images.slice(start, start + 3).map((image, index) => (
                    <img src={image} alt={`Image ${start + index + 1}`} key={index} />
                ))}
            </div>
            <div className="controls">
                <button onClick={() => handleClick("prev")} disabled={start === 0}>Prev</button>
                <button onClick={() => handleClick("next")} disabled={start === images.length - 3}>Next</button>
            </div>
        </div>
    );
}

export default SlidingImages;
